//@RunWith(PowerMockRunner.class)
@PrepareForTest({controller.Registration.class, model.Employee.class})

public class RegistrationTest {	
	HttpSession session = Mockito.mock(HttpSession.class);
	HttpServletRequest request = Mockito.mock(HttpServletRequest.class);
	HttpServletResponse response = Mockito.mock(HttpServletResponse.class);
	
	//Object of the class under test
	Registration registration = new Registration();
	
	//Mock and spy on the calls for the Employee class used in Registration
	Employee employeeMock = mock(Employee.class);
	Employee employeeSpy = spy(Employee.class);
	
	PrintWriter writer = Mockito.mock(PrintWriter.class);
	
	//Used to get the string Registration will use in Redirect and PrintWriter
	ArgumentCaptor<String> captor;
	
	//Value the PrintWriter should receive in Registration
	String successfulRegistration = "<script language='javascript'>window."
			+ "alert('Employee Detials Addded.');window.location="
			+ "'emplrhome.jsp';</script>";
	
	//Redirect link Registration should be using
	String failedRegistration = 
			"error.jsp?msg=Employee Registration Failed";
	
	//All values are set valid by default
	String eid = "100";
	String fname = "Clark";
	String lname = "Kent";
	String gen = "male";
	String dob = "1938-04-18";
	String job = "Hero";
	String contact = "911";
	String email = "super.man@email.com";
	String addr = "W 56th ST";
	String accno = "100";
	String bname = "Bank of America";
	
	@Before
	public void setUp() throws Exception {
		when(request.getSession(true)).thenReturn(session);
		
		when(response.getWriter()).thenReturn(writer);
		
		captor = ArgumentCaptor.forClass(String.class);
		
		when(request.getParameter("eid")).thenReturn(eid);
		when(request.getParameter("fname")).thenReturn(fname);
		when(request.getParameter("lname")).thenReturn(lname);
		when(request.getParameter("gen")).thenReturn(gen);
		when(request.getParameter("dob")).thenReturn(dob);
		when(request.getParameter("job")).thenReturn(job);
		when(request.getParameter("contact")).thenReturn(contact);
		when(request.getParameter("email")).thenReturn(email);
		when(request.getParameter("addr")).thenReturn(addr);
		when(request.getParameter("accno")).thenReturn(accno);
		when(request.getParameter("bname")).thenReturn(bname);
	}
	
	/*
	 * Test Case ID: PMS-UT-001-Registration-001
	 * Purpose: Test if doGet writes to PrintWriter when add employee
	 * is successful
	 * Test Setup: Mock of employee class
	 * Input: None
	 * Expected Output: Writer is equal to successfulRegistration
	 */
	@Test
	public void PMS_UT_001_Registration_001() throws Exception {
		//Mock can be used since the return value is ignored
		PowerMockito.whenNew(Employee.class).withNoArguments().
			thenReturn(employeeMock);
		
		//All valid values and the return value is replaced with success
		when(employeeMock.addEmployee(eid, fname, lname, gen, dob, job, 
				contact, email, addr, accno, bname)).thenReturn("success");

		//Run Registration class's doGet method
		registration.doGet(request, response);		
		
		//Capture data from PrintWriter
		verify(writer).print(captor.capture());
		
		assertEquals(successfulRegistration, captor.getValue());
	}
	
	/*
	 * Test Case ID: PMS_UT_002_Registration_002
	 * Purpose: Test if doGet redirects correctly user when addEmployee fails
	 * Test Setup: Mock of employee class
	 * Input: None
	 * Expected Output: Redirect runs with failedRegistration
	 */
	@Test
	public void PMS_UT_002_Registration_002() throws Exception {
		//Mock can be used since the return value is ignored
		PowerMockito.whenNew(Employee.class).withNoArguments().
			thenReturn(employeeMock);
		
		//One invalid value and the return value is replaced with fail
		when(employeeMock.addEmployee(eid, fname, lname, gen, dob, job, 
				contact, email, addr, accno, bname)).thenReturn("fail");
		
		//Run doGet method
		registration.doGet(request, response);
		
		//Capture the data used in the Redirect
		verify(response).sendRedirect(captor.capture());
		
		//Check if registration failed
		assertEquals(failedRegistration, captor.getValue());
	}
	
