	 * Input: eid = "1" , fname = "Adam" , lname = "Sandler" , gen = "on" , 
	 * dob = "1901-01-01" , job = "Movie Star" , contact = "0" , 
	 * email = "adam.sandler@email.com" , addr = "2121 SW 12TH ST" , 
	 * accno = "1",  bname = "Bank of America"
	 * Expected Output: Redirect runs with failedRegistration
	 */
