		String job = "Movie Star";
		String contact = "0";
		String email = "dam.sandler@email.com";
		String addr = "2121 SW 12TH ST";
		String accno = "1";
		String bname = "Bank of America";
		
		//Replace with duplicate values
		when(request.getParameter("eid")).thenReturn(eid);
		when(request.getParameter("fname")).thenReturn(fname);
		when(request.getParameter("lname")).thenReturn(lname);
		when(request.getParameter("gen")).thenReturn(gen);
		when(request.getParameter("dob")).thenReturn(dob);
		when(request.getParameter("job")).thenReturn(job);
		when(request.getParameter("contact")).thenReturn(contact);
		when(request.getParameter("email")).thenReturn(email);
		when(request.getParameter("addr")).thenReturn(addr);
		when(request.getParameter("accno")).thenReturn(accno);
		when(request.getParameter("bname")).thenReturn(bname);
		
		assertEquals("fail", employeeSpy.addEmployee(eid, fname, lname, 
				gen, dob, job, contact, email, addr, accno, bname));

		//Run doGet method
		registration.doGet(request, response);
		
		verify(response).sendRedirect(captor.capture());
		
		assertEquals(failedRegistration, captor.getValue());
	}
